    "Adjustable Fidelity Computational Aeroelasticity Procedure (AFCAP) Project",nt"tracking_summary":
    {ntt"total": 3,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:08:42.397568",nt"name": "adjustable-fidelity-computational-aeroelasticity-procedure-afcap-project",nt"isopen":
    true,nt"url": null,nt"notes": "NextGen proposes an approach to significantly
    enhance aeroelastic analysis capabilities over what is commonly available in linear
    analysis environments such as NASTANTM The approach to accomplish this builds upon
    an existing software framework that allows the integration of varying-fidelity aerodynamic
    modeling capability with varying videlit structural models. The approach utilizes
    inherently nonlinear aerodynamic predictions schemes that are incorporated into
    the aeroelastic solution strategy. Potentially large (geometrically nonlinear) structural
    deflections under the influence of nonlinear aerodynamic can be analyzed using the
    approach. Hierarchical levels of analysis capabilities are included, ranging from
    simple yet powerful empirical approaches to the complete coupling of high-order
    CFD codes and nonlinear structural models. An aeroservoelastic solution framework
    will be developed in Phase I resulting in a prototype nonlinear aeroelasticity method
    suitable for a proof-of-concept demonstration. The developed methods will be demonstrated
    on test cases of recent research interest, such as the Active Aeroelastic Wing (AAW)
    F/A-18 aircraft.",nt"license_title": "U.S. Government Work",nt"extras":
